    <div className='displayRow 게시글'>
        <div>{data.number}</div>
        <div>{data.subject}</div>
        <div>{data.view}</div>
    </div>

    );
}

export default function CommunityMain(){

    const 양식 = {
        number : '글 번호',
        subject : '제목',
        view : '조회수'
    }
    const data =[{
        number:'001',
        subject:'제목',
        view:'7'
