        view:'15'
    }
    ]


    return (
        <div>
            <Frame/>
            <Banner name={'게시판'}/>
            <ContentNav name={'공지사항'}/>

            <div className='communityContentBox'>
                <h1>공지사항</h1>
                    <div>
                        <게시글 data={data[0]}/>
                        <게시글 data={data[0]}/>
                        <게시글 data={data[0]}/>
                        <게시글 data={data[0]}/>
                    </div>
            </div>

            <Footer/>
        </div>

    );
}
